function tablesearch(){var e,t,n,a;for(e=document.getElementById("search-input").value.toUpperCase(),t=document.getElementById("listTable").getElementsByTagName("tr"),a=0;a<t.length;a++)for(tx=t[a].getElementsByTagName("td"),j=0;j<tx.length-1;j++)if(n=t[a].getElementsByTagName("td")[j]){if((n.textContent||n.innerText).toUpperCase().indexOf(e)>-1){t[a].style.display="";break}t[a].style.display="none"}}